<?php
session_start();
// Simple PHP to handle reservation POST
if ($_SERVER["REQUEST_METHOD"] === "POST" && isset($_POST['reserve_now'])) {
    $full_name = isset($_POST['full_name']) ? trim($_POST['full_name']) : '';
    $phone = isset($_POST['phone_number']) ? trim($_POST['phone_number']) : '';
    $email = isset($_POST['email']) ? trim($_POST['email']) : '';
    $location = isset($_POST['location']) ? trim($_POST['location']) : '';

    // Basic sanitization
    $safe_name = htmlspecialchars($full_name, ENT_QUOTES);

    // Prepare display values for booking
    $posted_date = $_POST['date'] ?? ($_GET['date'] ?? '');
    $posted_time = $_POST['time'] ?? ($_GET['time'] ?? '');
    $posted_people = $_POST['guests'] ?? ($_GET['people'] ?? '');

    // Build a human-friendly date string if possible
    $display_date_for_booking = '';
    if (!empty($posted_date)) {
        $d = DateTime::createFromFormat('Y-m-d', $posted_date);
        $display_date_for_booking = $d ? $d->format('d F Y') : $posted_date;
    }

    // Save booking to data/bookings.json
    $dataDir = __DIR__ . '/data';
    if (!is_dir($dataDir)) {
        @mkdir($dataDir, 0755, true);
    }
    $bookingsFile = $dataDir . '/bookings.json';
    $bookings = [];
    if (file_exists($bookingsFile)) {
        $bookings = json_decode(file_get_contents($bookingsFile), true) ?: [];
    }
    $maxId = 0;
    foreach ($bookings as $b) {
        $maxId = max($maxId, isset($b['id']) ? (int)$b['id'] : 0);
    }

    $guests = is_numeric($posted_people) ? (int)$posted_people : 2;
    $menu_name = $_POST['menu_name'] ?? ($_GET['menu'] ?? 'Reservation');
    $menu_slug = $_POST['menu_slug'] ?? ($_GET['menu'] ?? '');
    $menu_image = $_POST['menu_image'] ?? 'img/placeholder.jpg';
    $user_email = isset($_SESSION['user']['email']) ? $_SESSION['user']['email'] : '';

    $newBooking = [
        'id' => $maxId + 1,
        'menu_name' => $menu_name,
        'menu_slug' => $menu_slug,
        'image' => $menu_image,
        'status' => 'Reserved',
        'date' => $display_date_for_booking ?: ($posted_date ?: ''),
        'time' => $posted_time ?: '',
        'guests' => $guests,
        'days_ago' => 0,
        'user_email' => $user_email
    ];

    $bookings[] = $newBooking;
    file_put_contents($bookingsFile, json_encode($bookings, JSON_PRETTY_PRINT));

    $success_message = "âœ… Reservasi untuk $safe_name berhasil diproses! Kami akan menghubungi Anda segera.";

    // Redirect logged in users to profile > My Slot, otherwise ask to login
    if (!empty($user_email)) {
        header('Location: profile.php?tab=myslots');
        exit;
    } else {
        header('Location: login.php');
        exit;
    }
}

// Determine display date/time and people from GET parameters (sent from order.php)
$display_date = '30 November 2022';
$display_time = '09:30 PM';
$display_people = '2 People';

if (!empty($_GET['date'])) {
    // try to format date YYYY-MM-DD -> e.g. 30 November 2022
    $d = DateTime::createFromFormat('Y-m-d', $_GET['date']);
    if ($d) {
        $display_date = $d->format('d F Y');
    } else {
        $display_date = htmlspecialchars($_GET['date'], ENT_QUOTES);
    }
}
if (!empty($_GET['time'])) {
    $display_time = htmlspecialchars($_GET['time'], ENT_QUOTES);
}
if (!empty($_GET['people'])) {
    $p = intval($_GET['people']);
    if ($p > 0) {
        $display_people = $p . ' People';
    } else {
        $display_people = htmlspecialchars($_GET['people'], ENT_QUOTES);
    }
}
